column20:
As micro service is becoming more and more popular, service's port and address has been registered into some registery like zookeeper, etcd. There is no strong need to listen on certain port. The more service we have, the more port we should manage.
This PR promotes to enable swoole to choose listen port by OS. What we should do is like this,
<?php
$serv = new Swoole\Http\Server("127.0.0.1"); // port is optional now

$serv->on('Request', function($request, $response) {
    $response->end("<h1>Hello Swoole!</h1>");
});

$serv->on('managerStart', function (Swoole\Server $s) {
    var_dump($s->host);
    var_dump($s->port);
    // send host:port to etcd, zookeeper ...
});

$serv->start();

