@matyhtf Hi.
SO_REUSEPORT let two process listen same port.
But, with your example, we cannot create run two swoole process that listen same port.

run php test1.php, in background.
run another php test1.php, will cause a error:

$ php -d extension=$HOME/swoole-src/modules/swoole.so ~/test1.php 
[2018-08-31 14:04:42 @13721.0]	WARNING	swSocket_bind (ERROR 502): bind(127.0.0.1:9501) failed. Error: Address already in use [98]
PHP Fatal error:  Uncaught Swoole\Exception: failed to listen server port[127.0.0.1:9501]. Error: Address already in use[98]. in /home/vagrant/test1.php:2
Stack trace:
#0 /home/vagrant/test1.php(2): Swoole\Server->__construct('127.0.0.1', 9501)
#1 {main}
  thrown in /home/vagrant/test1.php on line 2

So, firstly, there is a problem. I think, we should re-open this pr.

test1.php:
<?php
$http = new \swoole_http_server("127.0.0.1", 9501);
socket_set_option($http->getSocket(), SOL_SOCKET, SO_REUSEADDR, 1);
socket_set_option($http->getSocket(), SOL_SOCKET, SO_REUSEPORT, 1);
$http->on('request', function ($request, $response) {
    $response->end("Hello Swoole. \n");
});
$http->start();

