New code allowed two swoole master listen same addr:port:
$http = new \swoole_http_server("127.0.0.1", 9501, SWOOLE_PROCESS, SWOOLE_SOCK_TCP, SWOOLE_SO_REUSEADDR|SWOOLE_SO_REUSEPORT);
$http->on('request', function ($request, $response) {
    $response->end("Hello Swoole. \n");
});
$http->start();

And, if two swoole master listen same addr:port.
We can start new swoole master listen same addr:port, tell old swoole master stop accept.

