@asheroto
thank you! It probably should have been in the document, not the README. We already have an introduction to this, which you can find here:
https://www.swoole.co.uk/docs/modules/swoole-server/configuration

Thanks for merging my PR.
Please be aware that the same security check should also be implemented in rawCookie method.
Test script:
#!/usr/bin/env php
<?php

declare(strict_types=1);

$http = new Swoole\Http\Server("0.0.0.0", 9501);
$http->on(
    "request",
    function (Swoole\Http\Request $request, Swoole\Http\Response $response) {
        if(isset($request->get['lang'])){
            $response->rawCookie('lang', $request->get['lang']);
        }
        $response->end(highlight_file(__FILE__, true));
    }
);
$http->start();

@twose
The function headers_sent() should return false as a prerequisite for session_*() functions. The output buffering is the mechanism that is supposed to prevent "sending the output" and marking headers as "sent".
The test failure indicates that the issue #1828 is not fully fixed. Not sure what happened between the Swoole versions 4.0.2 -> 4.5.x, but all these functions used to work fine. Maybe I'm missing something, but I clearly had all the session_*() functions working alongside the PHTML template engine using the output buffering ob_*() functions.

@twose
A basic session example came up in a very simple library (just one small class SessionMiddleware) providing compatibility of the native PHP sessions with Swoole and maintained by me. The bug report upscalesoftware/swoole-session#1 demonstrates how the output buffering by Twig breaks the sessions when the coroutines are enabled. However, the issue is more generic and can be reproduced w/o a template engine as shown below.
Sessions are not working when coroutines are enabled:
use Upscale\Swoole\Session\SessionMiddleware;

$server = new \Swoole\HTTP\Server('127.0.0.1', 8080);
$server->on('request', new SessionMiddleware(function ($request, $response) {
    ob_start();
//    echo "Test";
    ob_end_clean();

    $_SESSION['data'] = $_SESSION['data'] ?? rand();
    $response->end($_SESSION['data']);
}));
$server->start();
curl -c cookies.txt -b cookies.txt http://127.0.0.1:8080/
215539912

curl -c cookies.txt -b cookies.txt http://127.0.0.1:8080/
PHP Warning:  session_id(): Cannot change session id when headers already sent in vendor/upscale/swoole-session/src/SessionMiddleware.php on line 62
PHP Warning:  session_start(): Cannot start session when headers already sent in vendor/upscale/swoole-session/src/SessionMiddleware.php on line 63
PHP Warning:  session_id(): Cannot change session id when headers already sent in vendor/upscale/swoole-session/src/SessionMiddleware.php on line 80
The same implementation works fine when coroutines are disabled:
use Upscale\Swoole\Session\SessionMiddleware;

$server = new \Swoole\HTTP\Server('127.0.0.1', 8080);
$server->set([
    'enable_coroutine' => false,
]);
$server->on('request', new SessionMiddleware(function ($request, $response) {
    ob_start();
//    echo "Test";
    ob_end_clean();

    $_SESSION['data'] = $_SESSION['data'] ?? rand();
    $response->end($_SESSION['data']);
}));
$server->start();
curl -c cookies.txt -b cookies.txt http://127.0.0.1:8080/
2031979775

curl -c cookies.txt -b cookies.txt http://127.0.0.1:8080/
2031979775
The root cause is that the coroutines mess up the headers_sent flag despite the output buffering.

